import React from 'react';

function Header() {
    return (
        <React.Fragment>
        <header>
            <p>Microgoogol</p>
            <div className='header-content'>
                <img src={require('../../Photos/userIcon.png')}></img>
            </div>
            <div className='divider'></div>
        </header>
        </React.Fragment>
    );
}

export default Header;
